import React from "react";

const Profile = () => {
  return (
    <>
      <h1 className="resume">
        "If there is something that describes me, it is the adrenaline to start
        something new, the commitment to continue it and the resilience to
        continue despite unfavorable situations. With experience in the
        management of human capital in multinational companies, redirected to
        Front-end development, interface design and user experience, restless
        and in the constant search for new ideas, business orientation, with
        strategic, creative thinking, resilient and committed"
      </h1>
    </>
  );
};

export default Profile;
